// ProjectCard.js
import React from 'react';
import githubIcon from './logo/github.png';
import youtubeIcon from './icons/codeforces.png';
import './ProjectCardStyle.css';

const ProjectCard = ({ project }) => {
  const { title, description, githubLink, youtubeLink, image1, image2 } = project;

  return (
    <div className="project-card">
      <div className="images-section">
        <img src={image1} alt="Project Image 1" className="project-image" />
        <img src={image2} alt="Project Image 2" className="project-image" />
        <div className="social-icons">
          <a href={githubLink} target="_blank" rel="noopener noreferrer">
            <img src={githubIcon} alt="GitHub Icon" className="social-icon" />
          </a>
          <a href={youtubeLink} target="_blank" rel="noopener noreferrer">
            <img src={youtubeIcon} alt="YouTube Icon" className="social-icon" />
          </a>
        </div>
      </div>
      <div className="description-section">
        <h3>{title}</h3>
        <p>{description}</p>
      </div>
    </div>
  );
};

export default ProjectCard;
